import React from "react";

const MovieCard  = ({movie2})=>{
    return(
        <div className="movie">
            <div>
                <p>{movie2.Search[3].Year}</p>
            </div>
            <div>
                <img src={movie2.Search[3].Poster!=='N/A' ? movie2.Search[3].Poster : "https://via.placeholder.com/400" } alt={movie2.Search[3].Title}/>
            </div>
            <div>
                <span>{movie2.Search[3].Type}</span>
                <h3>{movie2.Search[3].Title}</h3>
            </div>
        </div>
    )
}

export default MovieCard;
